import React from "react";
import classes from "./HeroSection.module.css";
import trainerImage from "../../assets/trainer.jpg";

const HeroSection = () => {
  return (
    <section className={classes.hero}>
      <div className={classes.heroText}>
        <h2>We Are Pushing</h2>
        <h2>Limit Of The Year</h2>
        <h2>Core Strength</h2>
        <p>
          A unit of connected speech or writing, especially composed of more
          than one sentence, that forms a cohesive whole.
        </p>
        <button className={classes.btn}>Get Started Today +</button>
      </div>
      <img src={trainerImage} alt="Trainer" className={classes.heroImage} />
    </section>
  );
};

export default HeroSection;
